function sortTableByColumn(table, column, asc = true) {
    const dir = asc ? 1 : -1;
    const tBody = table.tBodies[0];
    const rows = Array.from(tBody.rows);

    // Sort each row
    const sortedRows = rows.sort((rowA, rowB) => {
        const a = rowA.cells[column].textContent.trim();
        const b = rowB.cells[column].textContent.trim();

        if (a < b) {
            return -1 * dir;
        }

        if (a > b) {
            return 1 * dir;
        }

        return 0;
    });

    // Remove existing TRs from the table
    while (tBody.firstChild) {
        tBody.removeChild(tBody.firstChild);
    }

    // Append the sorted rows
    tBody.append(...sortedRows);

    // Remember how the column is sorted
    table.querySelectorAll('th').forEach(th => th.classList.remove('asc', 'desc'));
    table.rows[0].cells[column].classList.toggle('asc', asc);
